import React from "react";
import "./Footer.css";

function Footer() {
  return (
    <div className="footer">
      <div class="google-map">
        <iframe
          src="[your unique google URL] "
          width="600"
          height="450"
          style="border:0;"
          allowfullscreen=""
          loading="lazy"
          referrerpolicy="no-referrer-when-downgrade"
        ></iframe>
      </div>
    </div>
  );
}

export default Footer;
